{"slot0456": "img src=\"https://s3.amazonaws.com/armslist-content/images/site/freepostadvertisementtitle.png\" alt=\"Keep up with the latest from The Armslist Media Channel!\"/><br/> <iframe width=\"460\" height=\"310\" src=\"https://www.youtube.com/embed/DvE_Ioa4H-o\" frameborder=\"0\" allowfullscreen></iframe", "slot0455": "float: left; clear: left; width: 100%; text-align: center; margin-top: 100px;", "slot0440": "'gallery' href='http://cdn2.armslist.com/sites/armslist/uploads/posts/2015/11/18/4869966_01_ak74_640.jpg'> <img class=\"gallery\" src='http://cdn2.armslist.com/sites/armslist/uploads/posts/2015/11/18/4869966_01_ak74_640.jpg' alt='' height=\"170\" />", "slot0437": "Belton, mo<br/> (816)315-1680<br/> $1000<br/> May trade for <br/> -desert eagle .44 or .50<br/> -.357 or .44 revolver 6\" or longer barrel <br/> -12 gauge shotgun + cash<br/> -long slide 9mm + cash<br/> Aimpoint PRO + cash<br/> Target ammo in .357 mag, 10mm, 7.62x39 or .308<br/> <br/> What I have here is a really cool little ak74<br/> -It was made by waffen works<br/> -It is chambered in 5.45x39<br/> -It comes with 6x 30 round circle 10 mags<br/> -I also have a mag limiter so one of the mags can have a 10 round capacity for hunting<br/> -it comes with a utg pro scope mount<br/> -in addition to the standard right side charging handle, there is a left side, fal style folding charging handle built into the dust cover. It is non reciprocating. It is a very cool addition for you right handed shooters. And they run like $200 by themselves. Can't be used with the scope mount on though.<br/> -I have 120 rounds silver bear fmj, and 84 rounds hornady ballistic tips<br/> -the for end is tapco with a magpul grip<br/> -the stock is ati and has an adjustable cheek piece<br/> -has a hogue pistol grip as well<br/> Paint was done by previous owner. Idk how it was done, but its holding up well.<br/> <br/> This is the smoothest shooting AK you will ever shoot. There is virtually no recoil, and its a blast to shoot. The only reason its for sale is that im just trying to consolidate calibers.<br/> <br/> NO FELONS, MINORS OR LOWBALLERS<br/> MO RESIDENTS FACE TO FACE<br/> KS RESIDENTS THROUGH FFL", "slot0438": "section>", "slot0006": "ak74", "slot0137": "4869966", "slot0309": "-ak74", "slot0414": "div class=\"hoverarea\"> <a class=\"subnav-link title\" title=\"Flag\">Flag</a> | <ul class=\"body flag-options\"> <li><span class=\"a\" data-href=\"/posts/4869966/flag?type=1\" title=\"Listing is a scam\" data-click=\"flag\" data-confirm=\"Are you sure you want to flag this listing as a scam?\">Scam</span></li> <li><span class=\"a\" data-href=\"/posts/4869966/flag?type=4\" title=\"Item has been listed repeatedly or listing is inflamatory or inappropriate for the site\" data-click=\"flag\" data-confirm=\"Are you sure you want to flag this listing as spam/inappropriate?\">Spam/Inappropriate</span></li> <li><span class=\"a\" data-href=\"/posts/4869966/flag?type=3\" title=\"Item is grossly overpriced\" data-click=\"flag\" data-confirm=\"Are you sure you want to flag this listing as overpriced?\">Over-priced</span></li> <li><span class=\"a\" data-href=\"/posts/4869966/flag?type=2\" title=\"Listing was made in wrong category\" data-click=\"flag\">Miscategorized</span></li> <li><span class=\"a\" data-href=\"/posts/4869966/flag?type=5\" title=\"Listing is not from a private party\" data-click=\"flag\" data-confirm=\"Are you sure you want to flag this listing as a vendor listing?\">Vendor Listing</span></li> <li><span class=\"a\" data-href=\"/posts/4869966/flag?type=6\" title=\"Seller/Buyer is not responding\" data-click=\"flag\" data-confirm=\"Are you sure you want to flag this listing as sold/unresponsive?\">Unresponsive</span></li> <li><p class=\"legal-message\">Report illegal firearms activity to 1-800-ATF-GUNS or your local police department.</p></li> </ul> </div> <a class=\"subnav-", "slot0358": "ak74", "slot0398": "Belton, mo, Kansas City, Missouri", "slot0279": "</a> <div class=\"rig