{"slot0456": "img src=\"https://s3.amazonaws.com/armslist-content/images/site/freepostadvertisementtitle.png\" alt=\"Keep up with the latest from The Armslist Media Channel!\"/><br/> <iframe width=\"460\" height=\"300\" src=\"https://www.youtube.com/embed/OE7xgd9izu4\" frameborder=\"0\" allowfullscreen></iframe", "slot0455": "float: left; clear: left; width: 100%; text-align: center; margin-top: 100px;", "slot0440": "'gallery' href='http://cdn2.armslist.com/sites/armslist/uploads/posts/2015/11/22/4881896_01_new_xlp_adams_arms_piston_kit__640.jpg'> <img class=\"gallery\" src='http://cdn2.armslist.com/sites/armslist/uploads/posts/2015/11/22/4881896_01_new_xlp_adams_arms_piston_kit__640.jpg' alt='' height=\"170\" /></a> <a class='gallery' href='http://cdn2.armslist.com/sites/armslist/uploads/posts/2015/11/22/4881896_02_new_xlp_adams_arms_piston_kit__640.jpg'> <img class=\"gallery\" src='http://cdn2.armslist.com/sites/armslist/uploads/posts/2015/11/22/4881896_02_new_xlp_adams_arms_piston_kit__640.jpg' alt='' height=\"170\" /></a> <a class='gallery' href='http://cdn2.armslist.com/sites/armslist/uploads/posts/2015/11/22/4881896_03_new_xlp_adams_arms_piston_kit__640.jpg'> <img class=\"gallery\" src='http://cdn2.armslist.com/sites/armslist/uploads/posts/2015/11/22/4881896_03_new_xlp_adams_arms_piston_kit__640.jpg' alt='' height=\"170\" />", "slot0437": "LNIB AA Piston kit with upgraded complete Voodoo Innovations low mass BCG. I put this on a Short Barrel Rifle and shot a 20 round box of Gemtech 300BLK 187 Subs with it and then traded the upper minus the piston kit to a friend. It comes with the complete AA kit plus the full BCG and a pistol length drive rod, the ID of the gas block is .750\"<br/> <br/> This design of this piston system is just incredible, especially when shot suppressed. It has 5 different gas settings for numerous applications (ie, subsonic) and is unique in that it can fit under most handguards that use a standard barrel nut, instead of having the block poking up in front of the handguard and disrupting the profile. It also is legitimately self-cleaning, and designed to shoot around 10,000 rounds before requiring to be cleaned. These kits are for a mid-length setup, but pistol, carbine and rifle length drive rods can be purchased separately from Adams Arms to fit whatever length is required.<br/> <br/> These run between $360-$380 + s/h + tax depending on where you buy them and that's without the VDI Lifecoat complete bolt that I have. The complete Lifecoat VDI bolts are between $55-$80 before shipping and or taxes. <br/> <br/> Here is the description from AA's website: <br/> <br/> This system will work with .223/5.56 x 45 mm NATO and 300BLK<br/> <br/> Kit includes:<br/> <br/> Patented One-Piece Low Mass Bolt Carrier<br/> XLP Multi-Adjustable Low Profile Gas Block<br/> Gas Plug<br/> Bushing Installation Rod<br/> Bolt Spring<br/> Drive Rod with Bushing and Spring<br/> Installation DVD<br/> The Adams Arms Piston System:<br/> <br/> A short stroke free floating piston system.<br/> Is Self-Cleaning.<br/> Carbon and gases are expelled forward, away from operator.<br/> Corrosive resistant coating processes.<br/> Harmonics are not transferred into the barrel.<br/> Adjustable gas settings for various applications.<br/> Doesn't vent directly to atmospheric pressure; this eliminates flash signature and super sonic crack which is optimal for night vision and suppresses fire.<br/> <br/> I am willing to ships a well, add $25 for shipping within the lower 48. I also have more pictures if needed as well as the original foam box and packaging.", "slot0438": "section>", "slot0006": "New XLP Adams Arms Piston Kit w/Upgraded Complete VDI Low Mass BCG", "slot0137": "4881896", "slot0309": "-new-xlp-adams-arms-piston-kit-w-upgraded-complete-vdi-low-mass-bcg", "slot0414": "div class=\"hoverarea\"> <a class=\"subnav-link title\" title=\"Flag\">Flag</a> | <ul class=\"body flag-options\"> <li><span class=\"a\" data-href=\"/posts/4881896/flag?